import React from "react";
import { RadioGroup } from "react-materialize";

import "./productForm.css";
import products from "../../constants/products.js";

const ProductForm = props => {

    let currentProduct = products.products.pos.questions1.map((item) => {
        console.log("new line" + item);
        return (
            <div className="customRadio">
                <input
                    type="radio" name="product"
                    id={products.products.pos.name} value="test" />
                <label for='test'>
                    <img className="radioImage"
                        src="//placekitten.com/151/151"
                        alt="I'm happy" />
                </label>
                <p>{item}</p>
            </div>
            );
    });

   const Test = () => {
    return(
    <RadioGroup label="demo" name="demo"
      options={[
        {
          label: 'Yes',
          value: <img className="radioImage"
          src="//placekitten.com/151/151"
          alt="I'm happy" />
        },
        {
          label: "No",
          value: "no"
        }
      ]}
      withGap
      {...field}
      radioClassNames="radioClass"
      required
    />
    )};


    return (
        <div className="radioDiv">
            <form>
                {currentProduct}
            </form>
            <Test />
        </div>
    )
};

export default ProductForm;
